20250727101849	{"-- Create function to update timestamps\nCREATE OR REPLACE FUNCTION public.update_updated_at_column()\nRETURNS TRIGGER AS $$\nBEGIN\n  NEW.updated_at = now();\n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\n-- Create a table for transactions\nCREATE TABLE public.transactions (\n  id UUID NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  user_id UUID NOT NULL REFERENCES auth.users(id) ON DELETE CASCADE,\n  type TEXT NOT NULL CHECK (type IN ('income', 'expense', 'transfer')),\n  amount DECIMAL(15,2) NOT NULL,\n  account_id UUID REFERENCES public.accounts(id) ON DELETE SET NULL,\n  to_account_id UUID REFERENCES public.accounts(id) ON DELETE SET NULL,\n  category_id UUID REFERENCES public.categories(id) ON DELETE SET NULL,\n  description TEXT NOT NULL,\n  beneficiary TEXT,\n  note TEXT,\n  payment_method TEXT,\n  location TEXT,\n  tags TEXT[] DEFAULT ARRAY[]::TEXT[],\n  transaction_date TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n  created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n  updated_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now()\n);\n\n-- Enable Row Level Security\nALTER TABLE public.transactions ENABLE ROW LEVEL SECURITY;\n\n-- Create policies for user access\nCREATE POLICY \\"Users can view their own transactions\\" \nON public.transactions \nFOR SELECT \nUSING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can create their own transactions\\" \nON public.transactions \nFOR INSERT \nWITH CHECK (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can update their own transactions\\" \nON public.transactions \nFOR UPDATE \nUSING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can delete their own transactions\\" \nON public.transactions \nFOR DELETE \nUSING (auth.uid() = user_id);\n\n-- Create trigger for automatic timestamp updates\nCREATE TRIGGER update_transactions_updated_at\nBEFORE UPDATE ON public.transactions\nFOR EACH ROW\nEXECUTE FUNCTION public.update_updated_at_column();\n\n-- Create indexes for better performance\nCREATE INDEX idx_transactions_user_id ON public.transactions(user_id);\nCREATE INDEX idx_transactions_date ON public.transactions(transaction_date);\nCREATE INDEX idx_transactions_account ON public.transactions(account_id);\nCREATE INDEX idx_transactions_category ON public.transactions(category_id);"}		veraomar1996@gmail.com	\N
20250728121017	{"-- Create function to update account balances when transactions are inserted, updated, or deleted\nCREATE OR REPLACE FUNCTION update_account_balance()\nRETURNS TRIGGER AS $$\nBEGIN\n  -- Handle INSERT\n  IF TG_OP = 'INSERT' THEN\n    -- Update the main account balance\n    UPDATE accounts \n    SET balance = balance + NEW.amount \n    WHERE id = NEW.account_id;\n    \n    -- For transfers, also update the destination account if it exists\n    IF NEW.to_account_id IS NOT NULL THEN\n      UPDATE accounts \n      SET balance = balance - NEW.amount \n      WHERE id = NEW.to_account_id;\n    END IF;\n    \n    RETURN NEW;\n  END IF;\n  \n  -- Handle UPDATE\n  IF TG_OP = 'UPDATE' THEN\n    -- Revert old transaction impact\n    UPDATE accounts \n    SET balance = balance - OLD.amount \n    WHERE id = OLD.account_id;\n    \n    IF OLD.to_account_id IS NOT NULL THEN\n      UPDATE accounts \n      SET balance = balance + OLD.amount \n      WHERE id = OLD.to_account_id;\n    END IF;\n    \n    -- Apply new transaction impact\n    UPDATE accounts \n    SET balance = balance + NEW.amount \n    WHERE id = NEW.account_id;\n    \n    IF NEW.to_account_id IS NOT NULL THEN\n      UPDATE accounts \n      SET balance = balance - NEW.amount \n      WHERE id = NEW.to_account_id;\n    END IF;\n    \n    RETURN NEW;\n  END IF;\n  \n  -- Handle DELETE\n  IF TG_OP = 'DELETE' THEN\n    -- Revert transaction impact\n    UPDATE accounts \n    SET balance = balance - OLD.amount \n    WHERE id = OLD.account_id;\n    \n    IF OLD.to_account_id IS NOT NULL THEN\n      UPDATE accounts \n      SET balance = balance + OLD.amount \n      WHERE id = OLD.to_account_id;\n    END IF;\n    \n    RETURN OLD;\n  END IF;\n  \n  RETURN NULL;\nEND;\n$$ LANGUAGE plpgsql;\n\n-- Create trigger to automatically update account balances\nDROP TRIGGER IF EXISTS trigger_update_account_balance ON transactions;\nCREATE TRIGGER trigger_update_account_balance\n  AFTER INSERT OR UPDATE OR DELETE ON transactions\n  FOR EACH ROW\n  EXECUTE FUNCTION update_account_balance();"}		veraomar1996@gmail.com	\N
20250728121048	{"-- Fix the security warnings by adding search_path parameter to functions\nDROP FUNCTION IF EXISTS update_account_balance() CASCADE;\n\nCREATE OR REPLACE FUNCTION update_account_balance()\nRETURNS TRIGGER \nSET search_path = public\nAS $$\nBEGIN\n  -- Handle INSERT\n  IF TG_OP = 'INSERT' THEN\n    -- Update the main account balance\n    UPDATE accounts \n    SET balance = balance + NEW.amount \n    WHERE id = NEW.account_id;\n    \n    -- For transfers, also update the destination account if it exists\n    IF NEW.to_account_id IS NOT NULL THEN\n      UPDATE accounts \n      SET balance = balance - NEW.amount \n      WHERE id = NEW.to_account_id;\n    END IF;\n    \n    RETURN NEW;\n  END IF;\n  \n  -- Handle UPDATE\n  IF TG_OP = 'UPDATE' THEN\n    -- Revert old transaction impact\n    UPDATE accounts \n    SET balance = balance - OLD.amount \n    WHERE id = OLD.account_id;\n    \n    IF OLD.to_account_id IS NOT NULL THEN\n      UPDATE accounts \n      SET balance = balance + OLD.amount \n      WHERE id = OLD.to_account_id;\n    END IF;\n    \n    -- Apply new transaction impact\n    UPDATE accounts \n    SET balance = balance + NEW.amount \n    WHERE id = NEW.account_id;\n    \n    IF NEW.to_account_id IS NOT NULL THEN\n      UPDATE accounts \n      SET balance = balance - NEW.amount \n      WHERE id = NEW.to_account_id;\n    END IF;\n    \n    RETURN NEW;\n  END IF;\n  \n  -- Handle DELETE\n  IF TG_OP = 'DELETE' THEN\n    -- Revert transaction impact\n    UPDATE accounts \n    SET balance = balance - OLD.amount \n    WHERE id = OLD.account_id;\n    \n    IF OLD.to_account_id IS NOT NULL THEN\n      UPDATE accounts \n      SET balance = balance + OLD.amount \n      WHERE id = OLD.to_account_id;\n    END IF;\n    \n    RETURN OLD;\n  END IF;\n  \n  RETURN NULL;\nEND;\n$$ LANGUAGE plpgsql SECURITY DEFINER;\n\n-- Recreate trigger to automatically update account balances\nDROP TRIGGER IF EXISTS trigger_update_account_balance ON transactions;\nCREATE TRIGGER trigger_update_account_balance\n  AFTER INSERT OR UPDATE OR DELETE ON transactions\n  FOR EACH ROW\n  EXECUTE FUNCTION update_account_balance();\n\n-- Fix the other function search_path warnings too\nDROP FUNCTION IF EXISTS handle_new_user() CASCADE;\n\nCREATE OR REPLACE FUNCTION handle_new_user()\nRETURNS TRIGGER \nSET search_path = public\nAS $$\nBEGIN\n  INSERT INTO public.profiles (id, username)\n  VALUES (NEW.id, NEW.email);\n  \n  INSERT INTO public.user_settings (user_id)\n  VALUES (NEW.id);\n  \n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql SECURITY DEFINER;\n\nDROP FUNCTION IF EXISTS update_updated_at_column() CASCADE;\n\nCREATE OR REPLACE FUNCTION update_updated_at_column()\nRETURNS TRIGGER \nSET search_path = public\nAS $$\nBEGIN\n  NEW.updated_at = now();\n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;"}		veraomar1996@gmail.com	\N
20250728023130	{"-- First, let's examine the current trigger and fix the balance calculation issue\n-- The issue seems to be in the trigger logic for transfers\n\n-- Drop and recreate the trigger function with corrected logic\nDROP FUNCTION IF EXISTS public.update_account_balance() CASCADE;\n\nCREATE OR REPLACE FUNCTION public.update_account_balance()\nRETURNS trigger\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path TO 'public'\nAS $function$\nBEGIN\n  -- Handle INSERT\n  IF TG_OP = 'INSERT' THEN\n    -- For transfers, the amount is already correctly calculated in the application\n    -- Debit transaction: amount is negative, affects account_id\n    -- Credit transaction: amount is positive, affects account_id\n    UPDATE accounts \n    SET balance = balance + NEW.amount \n    WHERE id = NEW.account_id;\n    \n    RETURN NEW;\n  END IF;\n  \n  -- Handle UPDATE\n  IF TG_OP = 'UPDATE' THEN\n    -- Revert old transaction impact\n    UPDATE accounts \n    SET balance = balance - OLD.amount \n    WHERE id = OLD.account_id;\n    \n    -- Apply new transaction impact\n    UPDATE accounts \n    SET balance = balance + NEW.amount \n    WHERE id = NEW.account_id;\n    \n    RETURN NEW;\n  END IF;\n  \n  -- Handle DELETE\n  IF TG_OP = 'DELETE' THEN\n    -- Revert transaction impact\n    UPDATE accounts \n    SET balance = balance - OLD.amount \n    WHERE id = OLD.account_id;\n    \n    RETURN OLD;\n  END IF;\n  \n  RETURN NULL;\nEND;\n$function$;\n\n-- Recreate the trigger\nCREATE TRIGGER trigger_update_account_balance\n  AFTER INSERT OR UPDATE OR DELETE ON transactions\n  FOR EACH ROW\n  EXECUTE FUNCTION update_account_balance();"}		veraomar1996@gmail.com	\N
20250728093751	{"-- Create contacts table\nCREATE TABLE public.contacts (\n  id UUID NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  user_id UUID NOT NULL,\n  contact_type TEXT NOT NULL CHECK (contact_type IN ('persona', 'empresa')),\n  name TEXT NOT NULL,\n  image_url TEXT,\n  address TEXT,\n  identification_number TEXT,\n  phone TEXT,\n  mobile TEXT,\n  email TEXT,\n  website TEXT,\n  internal_notes TEXT,\n  created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n  updated_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now()\n);\n\n-- Enable Row Level Security\nALTER TABLE public.contacts ENABLE ROW LEVEL SECURITY;\n\n-- Create policies for contacts\nCREATE POLICY \\"Users can view their own contacts\\" \nON public.contacts \nFOR SELECT \nUSING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can create their own contacts\\" \nON public.contacts \nFOR INSERT \nWITH CHECK (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can update their own contacts\\" \nON public.contacts \nFOR UPDATE \nUSING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can delete their own contacts\\" \nON public.contacts \nFOR DELETE \nUSING (auth.uid() = user_id);\n\n-- Create contact_tags junction table\nCREATE TABLE public.contact_tags (\n  contact_id UUID NOT NULL,\n  tag_id UUID NOT NULL,\n  PRIMARY KEY (contact_id, tag_id)\n);\n\n-- Enable RLS for contact_tags\nALTER TABLE public.contact_tags ENABLE ROW LEVEL SECURITY;\n\n-- Create policies for contact_tags\nCREATE POLICY \\"Users can view contact_tags for own contacts\\" \nON public.contact_tags \nFOR SELECT \nUSING (EXISTS (\n  SELECT 1 FROM contacts \n  WHERE contacts.id = contact_tags.contact_id \n  AND contacts.user_id = auth.uid()\n));\n\nCREATE POLICY \\"Users can create contact_tags for own contacts\\" \nON public.contact_tags \nFOR INSERT \nWITH CHECK (EXISTS (\n  SELECT 1 FROM contacts \n  WHERE contacts.id = contact_tags.contact_id \n  AND contacts.user_id = auth.uid()\n));\n\nCREATE POLICY \\"Users can delete contact_tags for own contacts\\" \nON public.contact_tags \nFOR DELETE \nUSING (EXISTS (\n  SELECT 1 FROM contacts \n  WHERE contacts.id = contact_tags.contact_id \n  AND contacts.user_id = auth.uid()\n));\n\n-- Add trigger for automatic timestamp updates\nCREATE TRIGGER update_contacts_updated_at\nBEFORE UPDATE ON public.contacts\nFOR EACH ROW\nEXECUTE FUNCTION public.update_updated_at_column();\n\n-- Add beneficiary and payer columns to transactions for contact tracking\nALTER TABLE public.transactions \nADD COLUMN contact_id UUID,\nADD COLUMN payer_contact_id UUID;"}		veraomar1996@gmail.com	\N
20250728095941	{"-- Add foreign key constraints for contact_tags table\nALTER TABLE contact_tags \nADD CONSTRAINT contact_tags_contact_id_fkey \nFOREIGN KEY (contact_id) REFERENCES contacts(id) ON DELETE CASCADE;\n\nALTER TABLE contact_tags \nADD CONSTRAINT contact_tags_tag_id_fkey \nFOREIGN KEY (tag_id) REFERENCES tags(id) ON DELETE CASCADE;"}		veraomar1996@gmail.com	\N
20250728115554	{"-- Create debts table to manage debts and loans\nCREATE TABLE public.debts (\n  id UUID NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  user_id UUID NOT NULL,\n  contact_id UUID NOT NULL,\n  account_id UUID NOT NULL,\n  type TEXT NOT NULL CHECK (type IN ('debt', 'loan')), -- 'debt' = I owe, 'loan' = they owe me\n  description TEXT NOT NULL,\n  initial_amount NUMERIC NOT NULL,\n  current_balance NUMERIC NOT NULL DEFAULT 0,\n  debt_date TIMESTAMP WITH TIME ZONE NOT NULL,\n  due_date TIMESTAMP WITH TIME ZONE,\n  status TEXT NOT NULL DEFAULT 'active' CHECK (status IN ('active', 'closed')),\n  created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n  updated_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now()\n);\n\n-- Enable RLS\nALTER TABLE public.debts ENABLE ROW LEVEL SECURITY;\n\n-- Create policies for debts\nCREATE POLICY \\"Users can view their own debts\\" \nON public.debts \nFOR SELECT \nUSING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can create their own debts\\" \nON public.debts \nFOR INSERT \nWITH CHECK (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can update their own debts\\" \nON public.debts \nFOR UPDATE \nUSING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can delete their own debts\\" \nON public.debts \nFOR DELETE \nUSING (auth.uid() = user_id);\n\n-- Add trigger for automatic timestamp updates\nCREATE TRIGGER update_debts_updated_at\nBEFORE UPDATE ON public.debts\nFOR EACH ROW\nEXECUTE FUNCTION public.update_updated_at_column();\n\n-- Create debt_payments table to track individual payments/transactions\nCREATE TABLE public.debt_payments (\n  id UUID NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  debt_id UUID NOT NULL,\n  transaction_id UUID,\n  amount NUMERIC NOT NULL, -- positive for payments, negative for increases\n  payment_date TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n  description TEXT,\n  created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now()\n);\n\n-- Enable RLS\nALTER TABLE public.debt_payments ENABLE ROW LEVEL SECURITY;\n\n-- Create policies for debt_payments\nCREATE POLICY \\"Users can view payments for their own debts\\" \nON public.debt_payments \nFOR SELECT \nUSING (EXISTS (\n  SELECT 1 FROM public.debts \n  WHERE debts.id = debt_payments.debt_id \n  AND debts.user_id = auth.uid()\n));\n\nCREATE POLICY \\"Users can create payments for their own debts\\" \nON public.debt_payments \nFOR INSERT \nWITH CHECK (EXISTS (\n  SELECT 1 FROM public.debts \n  WHERE debts.id = debt_payments.debt_id \n  AND debts.user_id = auth.uid()\n));\n\nCREATE POLICY \\"Users can update payments for their own debts\\" \nON public.debt_payments \nFOR UPDATE \nUSING (EXISTS (\n  SELECT 1 FROM public.debts \n  WHERE debts.id = debt_payments.debt_id \n  AND debts.user_id = auth.uid()\n));\n\nCREATE POLICY \\"Users can delete payments for their own debts\\" \nON public.debt_payments \nFOR DELETE \nUSING (EXISTS (\n  SELECT 1 FROM public.debts \n  WHERE debts.id = debt_payments.debt_id \n  AND debts.user_id = auth.uid()\n));\n\n-- Add foreign key constraints\nALTER TABLE public.debts \nADD CONSTRAINT debts_contact_id_fkey \nFOREIGN KEY (contact_id) REFERENCES public.contacts(id) ON DELETE CASCADE;\n\nALTER TABLE public.debts \nADD CONSTRAINT debts_account_id_fkey \nFOREIGN KEY (account_id) REFERENCES public.accounts(id) ON DELETE CASCADE;\n\nALTER TABLE public.debt_payments \nADD CONSTRAINT debt_payments_debt_id_fkey \nFOREIGN KEY (debt_id) REFERENCES public.debts(id) ON DELETE CASCADE;"}		veraomar1996@gmail.com	\N
20250801095837	{"-- Create scheduled_payments table\nCREATE TABLE public.scheduled_payments (\n  id UUID NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  user_id UUID NOT NULL,\n  name TEXT NOT NULL,\n  description TEXT,\n  type TEXT NOT NULL CHECK (type IN ('income', 'expense', 'transfer')),\n  category_id UUID,\n  account_id UUID,\n  to_account_id UUID, -- For transfers\n  amount NUMERIC NOT NULL,\n  payment_method TEXT,\n  contact_id UUID,\n  frequency_type TEXT NOT NULL CHECK (frequency_type IN ('once', 'recurring')),\n  start_date TIMESTAMP WITH TIME ZONE NOT NULL,\n  notification_days INTEGER DEFAULT 0, -- 0=none, 1=due_date, 2=one_day, 3=three_days, 7=one_week\n  -- Recurring payment fields\n  recurrence_pattern TEXT, -- 'daily', 'weekly', 'monthly', 'yearly'\n  recurrence_interval INTEGER DEFAULT 1, -- Every X days/weeks/months/years\n  recurrence_day_option TEXT, -- 'same_day', 'first_monday', etc.\n  end_type TEXT CHECK (end_type IN ('never', 'date', 'count')),\n  end_date TIMESTAMP WITH TIME ZONE,\n  end_count INTEGER,\n  note TEXT,\n  tags TEXT[] DEFAULT '{}',\n  is_active BOOLEAN DEFAULT true,\n  next_payment_date TIMESTAMP WITH TIME ZONE,\n  created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n  updated_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now()\n);\n\n-- Enable Row Level Security\nALTER TABLE public.scheduled_payments ENABLE ROW LEVEL SECURITY;\n\n-- Create policies for user access\nCREATE POLICY \\"Users can view their own scheduled payments\\" \nON public.scheduled_payments \nFOR SELECT \nUSING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can create their own scheduled payments\\" \nON public.scheduled_payments \nFOR INSERT \nWITH CHECK (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can update their own scheduled payments\\" \nON public.scheduled_payments \nFOR UPDATE \nUSING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can delete their own scheduled payments\\" \nON public.scheduled_payments \nFOR DELETE \nUSING (auth.uid() = user_id);\n\n-- Create trigger for automatic timestamp updates\nCREATE TRIGGER update_scheduled_payments_updated_at\nBEFORE UPDATE ON public.scheduled_payments\nFOR EACH ROW\nEXECUTE FUNCTION public.update_updated_at_column();"}		veraomar1996@gmail.com	\N
20250802060517	{"-- Create table to store dashboard card preferences\nCREATE TABLE public.dashboard_card_preferences (\n  id UUID NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  user_id UUID NOT NULL,\n  card_id TEXT NOT NULL,\n  card_type TEXT NOT NULL,\n  title TEXT NOT NULL,\n  position INTEGER NOT NULL,\n  visible BOOLEAN NOT NULL DEFAULT true,\n  created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n  updated_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n  UNIQUE(user_id, card_id)\n);\n\n-- Enable RLS\nALTER TABLE public.dashboard_card_preferences ENABLE ROW LEVEL SECURITY;\n\n-- Create policies\nCREATE POLICY \\"Users can view their own dashboard preferences\\" \nON public.dashboard_card_preferences \nFOR SELECT \nUSING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can create their own dashboard preferences\\" \nON public.dashboard_card_preferences \nFOR INSERT \nWITH CHECK (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can update their own dashboard preferences\\" \nON public.dashboard_card_preferences \nFOR UPDATE \nUSING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can delete their own dashboard preferences\\" \nON public.dashboard_card_preferences \nFOR DELETE \nUSING (auth.uid() = user_id);\n\n-- Create function to update timestamps\nCREATE OR REPLACE FUNCTION public.update_dashboard_card_preferences_updated_at()\nRETURNS TRIGGER AS $$\nBEGIN\n  NEW.updated_at = now();\n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\n-- Create trigger for automatic timestamp updates\nCREATE TRIGGER update_dashboard_card_preferences_updated_at\nBEFORE UPDATE ON public.dashboard_card_preferences\nFOR EACH ROW\nEXECUTE FUNCTION public.update_dashboard_card_preferences_updated_at();"}		veraomar1996@gmail.com	\N
20250802060545	{"-- Fix the function to have a proper search path\nCREATE OR REPLACE FUNCTION public.update_dashboard_card_preferences_updated_at()\nRETURNS TRIGGER \nLANGUAGE plpgsql\nSET search_path TO 'public'\nAS $$\nBEGIN\n  NEW.updated_at = now();\n  RETURN NEW;\nEND;\n$$;"}		veraomar1996@gmail.com	\N
20250808054457	{"-- Add order column to accounts, categories, and tags tables\nALTER TABLE public.accounts ADD COLUMN display_order INTEGER DEFAULT 0;\nALTER TABLE public.categories ADD COLUMN display_order INTEGER DEFAULT 0;\nALTER TABLE public.tags ADD COLUMN display_order INTEGER DEFAULT 0;\n\n-- Create indexes for better performance on ordering\nCREATE INDEX idx_accounts_display_order ON public.accounts(user_id, display_order);\nCREATE INDEX idx_categories_display_order ON public.categories(user_id, display_order);\nCREATE INDEX idx_tags_display_order ON public.tags(user_id, display_order);"}		veraomar1996@gmail.com	\N
